import React from 'react';
import { FaWhatsapp, FaInstagram, FaFacebook, FaEnvelope } from 'react-icons/fa';
import SimpleMap from '../components/SimpleMap'; // Importe o componente de mapa

function Contato() {
  return (
    <div className="contact-page">
      <h2 style={{ textAlign: 'center', marginBottom: '20px', fontSize: '24px' }}>Entre em contato conosco</h2>
      
      <div className="contact-links" style={{ display: 'flex', justifyContent: 'center', flexDirection: 'column', alignItems: 'center' }}>
        <a href="https://api.whatsapp.com/send?phone=seu_numero_aqui" style={{ textDecoration: 'none', margin: '10px 0', color: 'black', fontSize: '18px' }}>
          <FaWhatsapp /> (99) 99999-9999
        </a>
        <a href="https://www.instagram.com/seu_usuario/" style={{ textDecoration: 'none', margin: '10px 0', color: 'black', fontSize: '18px' }}>
          <FaInstagram /> @aloha_turismo
        </a>
        <a href="https://www.facebook.com/seu_usuario/" style={{ textDecoration: 'none', margin: '10px 0', color: 'black', fontSize: '18px' }}>
          <FaFacebook /> /AlohaTurismo
        </a>
        <a href="mailto:seu_email@exemplo.com" style={{ textDecoration: 'none', margin: '10px 0', color: 'black', fontSize: '18px' }}>
          <FaEnvelope /> contato@alohaturismo.com
        </a>
      </div>

      <SimpleMap /> {/* Integrando o componente de mapa */}
    </div>
  );
}

export default Contato;
